import Switch from 'react-switch';
import { ThemeContext } from 'styled-components';

import { ContainerContact, TextTitle, SubTextTitle, BoxContact, Icon, BoxTexts, TitleContact, LinkText } from './styles';
import { FiArrowDown } from "react-icons/fi";
interface Props {
    toggleTheme(): void;
}

const Contact: React.FC<Props> = ({ toggleTheme }) => {
    const { colors, title } = useContext(ThemeContext);

    return (
        <ContainerContact>
            <TextTitle>Contato</TextTitle>
            <SubTextTitle>Caso você queira entrar em contato sinta-se à vontade usando um dos links abaixo</SubTextTitle>
            
            
            <BoxContact>
                <Icon></Icon>

                <BoxTexts>
                    <TitleContact>Linkedin</TitleContact>
                    <LinkText></LinkText>
                </BoxTexts>
            </BoxContact>

            <BoxContact>
                <Icon></Icon>

                <BoxTexts>
                    <TitleContact>Linkedin</TitleContact>
                    <LinkText></LinkText>
                </BoxTexts>
            </BoxContact>
            
            <BoxContact>
                <Icon></Icon>

                <BoxTexts>
                    <TitleContact>Linkedin</TitleContact>
                    <LinkText></LinkText>
                </BoxTexts>
            </BoxContact>

            <BoxContact>
                <Icon></Icon>

                <BoxTexts>
                    <TitleContact>Linkedin</TitleContact>
                    <LinkText></LinkText>
                </BoxTexts>
            </BoxContact>
        </ContainerContact>
    );
}

export default Contact;
